/* eslint-disable no-use-before-define */
import React from 'react';
import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';

export default function Grouped() {
  const options = [
    { title: 'Reach' },
    { title: 'Impressions'},
    { title: 'Cost per Result' },
    { title: 'Daily budget' },
    { title: 'Ad Spend' },
    { title: "Link Clicks" },
    { title: 'CPC (Link Click)' },
    { title: 'CTR(Link)' },
    { title: 'Click(all)'},
    { title: 'CPC(all)'},
    { title: 'CTR(all)'},
    { title: 'Frequency'},
    { title: 'CPM(cost per 1000 impressions)'},
    { title: 'Purchase ROAS'},
    { title: 'Cost per lead'},
    { title: 'Total lead'},
    { title: 'Lead convesion value'},    
    { title: 'Total Purchase'},    
    { title: 'Cost per Purchase'},    
    { title: 'Purchase Value'},    

  ];

  return (
    <Autocomplete
      id="grouped-demo"
      options={options}
      groupBy={(option) => "Ad Performance"}
      getOptionLabel={(option) => option.title}
      style={{ width: 300 }}
      autoHighlight={"true"}
      renderInput={(params) => <TextField {...params} label="Campaign Ad Spend" variant="outlined" />}
    />
  );
}
